import React from "react"
import { Typography, Card, CardContent, CardActions } from "@material-ui/core"

const NoteCard = (note) => {
  console.log(note)
  return (
    <Card>
      <CardContent>
        <Typography variant="body2" color="textSecondary" component="p">
          {note?.note?.content}
        </Typography>
      </CardContent>
    </Card>
  )
}

export default NoteCard
